import React from 'react';
import {Link} from 'react-router-dom';






    const Footer= ()=> {
    
      
    //   const scrollTop = () => {
    //       window.scrollTo(0, 0);
    //   }
    //   useEffect(() => {
    //     window.addEventListener('scroll', scrollHandleScroll);
    //   },[]);
  return (
    <div className="footer__wrapper padding__top">
             <div className="container">
                <div className="row">
                     <div className="col-lg-4">
                         <div className="footer__one">
                             <h3 className="footer__title">Contact Us</h3>
                             <ul className="footer__list1">
                                 {/* <li><FontAwesomeIcon icon={['fas', 'phone-volume']}/>Phone: +1 516 231 1313</li>
                                 <li><FontAwesomeIcon icon={['fas', 'envelope']}/>Mail: 0devdesign.studio@gmail.com</li>
                                 <li><FontAwesomeIcon icon={['fas', 'home']}/>Address: 3366  Jefferson Street, NEW HAMPTON, IA</li>
                                 <li><FontAwesomeIcon icon={['fas', 'clock']}/>Working day: 9am - 5pm EST, Monday - Friday</li> */}
                             </ul>
                             <ul className="footer__social">
                                 <li><a href="www.factbook.com"><FontAwesomeIcon icon={['fab', 'facebook-f']}/></a></li>
                                 <li><a href="www.factbook.com"><FontAwesomeIcon icon={['fab', 'twitter']}/></a></li>
                                 <li><a href="www.factbook.com"><FontAwesomeIcon icon={['fab', 'linkedin-in']}/></a></li>
                                 <li><a href="www.factbook.com"><FontAwesomeIcon icon={['fab', 'instagram']}/></a></li>
                             </ul>
                         </div>
                     </div>
                     <div className="col-lg-4">
                        <div className="footer__one">
                             <h3 className="footer__title">Information</h3>
                             <ul className="footer__list2">
                                <li onClick={()=>scrollTop()}><Link to="/"> - Home</Link></li>
                                <li onClick={()=>scrollTop()}><Link to="/teachers"> - Teachers</Link></li>
                                <li onClick={()=>scrollTop()}><Link to="/aboutus"> - About Us</Link></li>
                                <li onClick={()=>scrollTop()}><Link to="/contact"> - Contact</Link></li>
                                <li onClick={()=>scrollTop()}><Link to="/error"> - Error</Link></li>
                             </ul>
                         </div>
                     </div>
                     <div className="col-lg-4">
                        <div className="footer__one">
                             <h3 className="footer__title">Our Gallery</h3>
                             
                         </div>
                     </div>
                 </div>
                 <div className="row">
                     <div className="col-lg-12 text-center">
                         <p className="copy__right">
                         ©2020 Dev - Kindergarten is Product Created by Devdesign.studio
                         </p>
                     </div>
                 </div>
             </div>

             
        </div>
  )};

  
export default Footer;
